.leaflet-pane,
.leaflet-tile,
.leaflet-marker-icon,
.leaflet-marker-shadow,
.leaflet-tile-container,
.leaflet-pane > svg,
.leaflet-pane > canvas,
.leaflet-zoom-box,
.leaflet-image-layer,
.leaflet-layer {
	position: absolute;
	left: 0;
	top: 0;
	}
.leaflet-container {
	overflow: hidden;
	}
.leaflet-tile,
.leaflet-marker-icon,
.leaflet-marker-shadow {
	-webkit-user-select: none;
	   -moz-user-select: none;
	        user-select: none;
	  -webkit-user-drag: none;
	}
/* Prevents IE11 from highlighting tiles in blue */
.leaflet-tile::selection {
	background: transparent;
}
/* Safari renders non-retina tile on retina better with this, but Chrome is worse */
.leaflet-safari .leaflet-tile {
	image-rendering: -webkit-optimize-contrast;
	}
/* hack that prevents hw layers "stretching" when loading new tiles */
.leaflet-safari .leaflet-tile-container {
	width: 1600px;
	height: 1600px;
	-webkit-transform-origin: 0 0;
	}
.leaflet-marker-icon,
.leaflet-marker-shadow {
	display: block;
	}
/* .leaflet-container svg: reset svg max-width decleration shipped in Joomla! (joomla.org) 3.x */
/* .leaflet-container img: map is broken in FF if you have max-width: 100% on tiles */
.leaflet-container .leaflet-overlay-pane svg,
.leaflet-container .leaflet-marker-pane img,
.leaflet-container .leaflet-shadow-pane img,
.leaflet-container .leaflet-tile-pane img,
.leaflet-container img.leaflet-image-layer,
.leaflet-container .leaflet-tile {
	max-width: none !important;
	max-height: none !important;
	}

.leaflet-container.leaflet-touch-zoom {
	-ms-touch-action: pan-x pan-y;
	touch-action: pan-x pan-y;
	}
.leaflet-container.leaflet-touch-drag {
	-ms-touch-action: pinch-zoom;
	/* Fallback for FF which doesn't support pinch-zoom */
	touch-action: none;
	touch-action: pinch-zoom;
}
.leaflet-container.leaflet-touch-drag.leaflet-touch-zoom {
	-ms-touch-action: none;
	touch-action: none;
}
.leaflet-container {
	-webkit-tap-highlight-color: transparent;
}
.leaflet-container a {
	-webkit-tap-highlight-color: rgba(51, 181, 229, 0.4);
}
.leaflet-tile {
	filter: inherit;
	visibility: hidden;
	}
.leaflet-tile-loaded {
	visibility: inherit;
	}
.leaflet-zoom-box {
	width: 0;
	height: 0;
	-moz-box-sizing: border-box;
	     box-sizing: border-box;
	z-index: 800;
	}
/* workaround for https://bugzilla.mozilla.org/show_bug.cgi?id=888319 */
.leaflet-overlay-pane svg {
	-moz-user-select: none;
	}

.leaflet-pane         { z-index: 400; }

.leaflet-tile-pane    { z-index: 200; }
.leaflet-overlay-pane { z-index: 400; }
.leaflet-shadow-pane  { z-index: 500; }
.leaflet-marker-pane  { z-index: 600; }
.leaflet-tooltip-pane   { z-index: 650; }
.leaflet-popup-pane   { z-index: 700; }

.leaflet-map-pane canvas { z-index: 100; }
.leaflet-map-pane svg    { z-index: 200; }

.leaflet-vml-shape {
	width: 1px;
	height: 1px;
	}
.lvml {
	behavior: url(#default#VML);
	display: inline-block;
	position: absolute;
	}


/* control positioning */

.leaflet-control {
	position: relative;
	z-index: 800;
	pointer-events: visiblePainted; /* IE 9-10 doesn't have auto */
	pointer-events: auto;
	}
.leaflet-top,
.leaflet-bottom {
	position: absolute;
	z-index: 1000;
	pointer-events: none;
	}
.leaflet-top {
	top: 0;
	}
.leaflet-right {
	right: 0;
	}
.leaflet-bottom {
	bottom: 0;
	}
.leaflet-left {
	left: 0;
	}
.leaflet-control {
	float: left;
	clear: both;
	}
.leaflet-right .leaflet-control {
	float: right;
	}
.leaflet-top .leaflet-control {
	margin-top: 10px;
	}
.leaflet-bottom .leaflet-control {
	margin-bottom: 10px;
	}
.leaflet-left .leaflet-control {
	margin-left: 10px;
	}
.leaflet-right .leaflet-control {
	margin-right: 10px;
	}


/* zoom and fade animations */

.leaflet-fade-anim .leaflet-tile {
	will-change: opacity;
	}
.leaflet-fade-anim .leaflet-popup {
	opacity: 0;
	-webkit-transition: opacity 0.2s linear;
	   -moz-transition: opacity 0.2s linear;
	        transition: opacity 0.2s linear;
	}
.leaflet-fade-anim .leaflet-map-pane .leaflet-popup {
	opacity: 1;
	}
.leaflet-zoom-animated {
	-webkit-transform-origin: 0 0;
	    -ms-transform-origin: 0 0;
	        transform-origin: 0 0;
	}
.leaflet-zoom-anim .leaflet-zoom-animated {
	will-change: transform;
	}
.leaflet-zoom-anim .leaflet-zoom-animated {
	-webkit-transition: -webkit-transform 0.25s cubic-bezier(0,0,0.25,1);
	   -moz-transition:    -moz-transform 0.25s cubic-bezier(0,0,0.25,1);
	        transition:         transform 0.25s cubic-bezier(0,0,0.25,1);
	}
.leaflet-zoom-anim .leaflet-tile,
.leaflet-pan-anim .leaflet-tile {
	-webkit-transition: none;
	   -moz-transition: none;
	        transition: none;
	}

.leaflet-zoom-anim .leaflet-zoom-hide {
	visibility: hidden;
	}


/* cursors */

.leaflet-interactive {
	cursor: pointer;
	}
.leaflet-grab {
	cursor: -webkit-grab;
	cursor:    -moz-grab;
	cursor:         grab;
	}
.leaflet-crosshair,
.leaflet-crosshair .leaflet-interactive {
	cursor: crosshair;
	}
.leaflet-popup-pane,
.leaflet-control {
	cursor: auto;
	}
.leaflet-dragging .leaflet-grab,
.leaflet-dragging .leaflet-grab .leaflet-interactive,
.leaflet-dragging .leaflet-marker-draggable {
	cursor: move;
	cursor: -webkit-grabbing;
	cursor:    -moz-grabbing;
	cursor:         grabbing;
	}

/* marker & overlays interactivity */
.leaflet-marker-icon,
.leaflet-marker-shadow,
.leaflet-image-layer,
.leaflet-pane > svg path,
.leaflet-tile-container {
	pointer-events: none;
	}

.leaflet-marker-icon.leaflet-interactive,
.leaflet-image-layer.leaflet-interactive,
.leaflet-pane > svg path.leaflet-interactive,
svg.leaflet-image-layer.leaflet-interactive path {
	pointer-events: visiblePainted; /* IE 9-10 doesn't have auto */
	pointer-events: auto;
	}

/* visual tweaks */

.leaflet-container {
	background: #ddd;
	outline: 0;
	}
.leaflet-container a {
	color: #0078A8;
	}
.leaflet-container a.leaflet-active {
	outline: 2px solid orange;
	}
.leaflet-zoom-box {
	border: 2px dotted #38f;
	background: rgba(255,255,255,0.5);
	}


/* general typography */
.leaflet-container {
	font: 12px/1.5 "Helvetica Neue", Arial, Helvetica, sans-serif;
	}


/* general toolbar styles */

.leaflet-bar {
	box-shadow: 0 1px 5px rgba(0,0,0,0.65);
	border-radius: 4px;
	}
.leaflet-bar a,
.leaflet-bar a:hover {
	background-color: #fff;
	border-bottom: 1px solid #ccc;
	width: 26px;
	height: 26px;
	line-height: 26px;
	display: block;
	text-align: center;
	text-decoration: none;
	color: black;
	}
.leaflet-bar a,
.leaflet-control-layers-toggle {
	background-position: 50% 50%;
	background-repeat: no-repeat;
	display: block;
	}
.leaflet-bar a:hover {
	background-color: #f4f4f4;
	}
.leaflet-bar a:first-child {
	border-top-left-radius: 4px;
	border-top-right-radius: 4px;
	}
.leaflet-bar a:last-child {
	border-bottom-left-radius: 4px;
	border-bottom-right-radius: 4px;
	border-bottom: none;
	}
.leaflet-bar a.leaflet-disabled {
	cursor: default;
	background-color: #f4f4f4;
	color: #bbb;
	}

.leaflet-touch .leaflet-bar a {
	width: 30px;
	height: 30px;
	line-height: 30px;
	}
.leaflet-touch .leaflet-bar a:first-child {
	border-top-left-radius: 2px;
	border-top-right-radius: 2px;
	}
.leaflet-touch .leaflet-bar a:last-child {
	border-bottom-left-radius: 2px;
	border-bottom-right-radius: 2px;
	}

/* zoom control */

.leaflet-control-zoom-in,
.leaflet-control-zoom-out {
	font: bold 18px 'Lucida Console', Monaco, monospace;
	text-indent: 1px;
	}

.leaflet-touch .leaflet-control-zoom-in, .leaflet-touch .leaflet-control-zoom-out  {
	font-size: 22px;
	}

/* attribution and scale controls */

.leaflet-container .leaflet-control-attribution {
	background: #fff;
	background: rgba(255, 255, 255, 0.7);
	margin: 0;
	}
.leaflet-control-attribution,
.leaflet-control-scale-line {
	padding: 0 5px;
	color: #333;
	}
.leaflet-control-attribution a {
	text-decoration: none;
	}
.leaflet-control-attribution a:hover {
	text-decoration: underline;
	}
.leaflet-container .leaflet-control-attribution,
.leaflet-container .leaflet-control-scale {
	font-size: 11px;
	}
.leaflet-left .leaflet-control-scale {
	margin-left: 5px;
	}
.leaflet-bottom .leaflet-control-scale {
	margin-bottom: 5px;
	}
.leaflet-control-scale-line {
	border: 2px solid #777;
	border-top: none;
	line-height: 1.1;
	padding: 2px 5px 1px;
	font-size: 11px;
	white-space: nowrap;
	overflow: hidden;
	-moz-box-sizing: border-box;
	     box-sizing: border-box;

	background: #fff;
	background: rgba(255, 255, 255, 0.5);
	}
.leaflet-control-scale-line:not(:first-child) {
	border-top: 2px solid #777;
	border-bottom: none;
	margin-top: -2px;
	}
.leaflet-control-scale-line:not(:first-child):not(:last-child) {
	border-bottom: 2px solid #777;
	}

.leaflet-touch .leaflet-control-attribution,
.leaflet-touch .leaflet-control-layers,
.leaflet-touch .leaflet-bar {
	box-shadow: none;
	}
.leaflet-touch .leaflet-control-layers,
.leaflet-touch .leaflet-bar {
	border: 2px solid rgba(0,0,0,0.2);
	background-clip: padding-box;
	}


/* popup */

.leaflet-popup {
	position: absolute;
	text-align: center;
	margin-bottom: 20px;
	}
.leaflet-popup-content-wrapper {
	padding: 1px;
	text-align: left;
	border-radius: 12px;
	}
.leaflet-popup-content {
	margin: 13px 19px;

"^16",10897.88,"^17",true],"^1J",["^ ","^4","atom"],"^1K",["^ ","^4","atom"],"^1L",["^ ","^4","atom"],"^1M",["^ ","^4","atom"],"^1N",["^ ","^4","atom"],"^1O",["^ ","^4","atom"],"^1P",["^ ","^4","atom"],"^1Q",["^ ","^4","atom"],"^1R",["^ ","^4","atom"],"^1S",["^ ","^4","atom"],"^1T",["^ ","^4","atom"],"^1U",["^ ","^4","atom"]]]],"countryMeta",["^ ","BR",["^ ","adminregion",["^ ","^4","atom","^16","XJ"],"en",["^ ","^4","atom","^16",["^ ","Vitalregistrationcomplete","Yes","PPPsurveyyear","2017, 2011","Latestindustrialdata","2013","Latesthouseholdsurvey","National Health Survey, 2013","Nationalaccountsbaseyear","Original chained constant price data are rescaled.","SNApricevaluation","Value added at basic prices (VAB)","BalanceofPaymentsManualinuse","BPM6","Latestpopulationcensus","2020 (expected)","2-alphacode","BR","CurrencyUnit","Brazilian real","TableName","Brazil","LongName","Federative Republic of Brazil","financeName","Brazil","SourceofmostrecentIncomeandexpendituredata","Integrated household survey (IHS), 2016","Lendingcategory","IBRD","Nationalaccountsreferenceyear","2010","Region","Latin America & Caribbean","capital","Brasilia","IMFdatadisseminationstandard","Special Data Dissemination Standard Plus (SDDS Plus)","ExternaldebtReportingstatus","Actual","GovernmentAccountingconcept","Consolidated central government","Systemoftrade","Special trade system","name","Brazil","SystemofNationalAccounts","Country uses the 2008 System of National Accounts methodology","Latestagriculturalcensus","2006","Latesttradedata","2018","IncomeGroup","Upper middle income","WB-2code","BR","ShortName","Brazil"]],"id",["^ ","^4","atom","^16","BRA"],"incomelevel",["^ ","^4","atom","^16","XT"],"locationType",["^ ","^4","atom","^16","country"],"locations",["^ ","^4","atom"],"^2K",["^ ","^4","atom","^16","Brazil"],"region",["^ ","^4","atom","^16","ZJ"]]],"indicatorMeta",["^ ","^2",["^ ","License_Type",["^ ","^4","atom","^16","CC BY-4.0"],"License_URL",["^ ","^4","atom","^16","https://datacatalog.worldbank.org/public-licenses#cc-by"],"WDITable",["^ ","^4","atom","^16","5.13"],"decimal",["^ ","^4","atom","^16",0],"description",["^ ","^4","atom"],"en",["^ ","^4","atom","^16",["^ ","Developmentrelevance","A scientific journal is a periodical publication intended to further the progress of science, usually by reporting new research. Most journals are highly specialized, although some of the oldest journals such as Nature publish articles and scientific papers across a wide range of scientific fields. Scientific journals contain articles that have been peer reviewed. When a scientific journal describes experiments or calculations, they must supply enough details that an independent researcher could repeat the experiment or calculation to verify the results. Each such journal article becomes part of the permanent scientific record.\n\nSome journals, such as Nature, Science, Proceedings of the National Academy of Sciences of the United States of America (PNAS), and Physical Review Letters, have a reputation of publishing articles that mark a fundamental breakthrough in their respective fields.","Statisticalconceptandmethodology","The number of scientific and engineering articles published in the following fields: physics, biology, chemistry, mathematics, clinical medicine, biomedical research, engineering and technology, and earth and space sciences. The NSF considers article counts from a set of journals covered by Science Citation Index (SCI) and Social Sciences Citation Index (SSCI).","Aggregationmethod","Gap-filled total","Periodicity","Annual","Topic","Infrastructure: Technology","Source","National Science Foundation, Science and Engineering Indicators.","Longdefinition","Scientific and technical journal articles refer to the number of scientific and engineering articles published in the following fields: physics, biology, chemistry, mathematics, clinical medicine, biomedical research, engineering and technology, and earth and space sciences.","^2X","https://datacatalog.worldbank.org/public-licenses#cc-by","sourceNote","Scientific and technical journal articles refer to the number of scientific and engineering articles published in the following fields: physics, biology, chemistry, mathematics, clinical medicine, biomedical research, engineering and technology, and earth and space sciences.","^2W","CC BY-4.0","Limitationsandexceptions","Scientific and technical article counts are from journals classified by the Institute for Scientific Information's Science Citation Index (SCI) and Social Sciences Citation Index (SSCI). Counts are based on fractional assignments; articles with authors from different countries are allocated proportionately to each country. The SCI and SSCI databases cover the core set of scientific journals but may exclude some of local importance and may reflect some bias toward English-language journals.\nArticles are classified by year of publication and assigned to region/country/economy on basis of institutional address(es) listed on the article. Articles are counted on a fractional-count basis that is, for articles with collaborating institutions from multiple countries/economies, each country/economy receives fractional credit on basis of proportion of its participating institutions. Details may not add to total because of rounding.","fullname","Scientific and technical journal articles","sourceOrganization","National Science Foundation, Science and Engineering Indicators.","shortname","Scientific and technical journal articles","IndicatorName","Scientific and technical journal articles"]],"^39",["^ ","^4","atom","^16","Scientific and technical journal articles"],"id",["^ ","^4","atom","^16","IP.JRN.ARTC.SC"],"last_year",["^ ","^4","atom","^16",[2018,["LR","MD","IS","LT","BN","BJ","SV","RO","MT","CV","NP","ES","TV","NR","MR","TJ","PH","SI","KH","GR","OM","SZ","RW","MX","AD","BF","KE","CU","TN","ZW","KW","MK","VN","PY","HU","ER","EE","SY","MN","SL","T3","GH","AR","HN","ML","LU","NZ","PE","FJ","JM","BD","PT","KG","PL","RU","CL","AO","UG","CO","TH","SK","TL","FM","ID","AE","DM","GQ","BW","T4","KR","DJ","AU","KZ","WS","BA","CY","KN","DZ","KP","LC","DK","DE","SB","CM","SD","PR","RS","IN","LV","CG","AT","T7","MH","SO","SM","UY","LA","CN","HT","BH","T2","NL","LK","NE","YE","TO","SS","MY","SC","NI","TM","AZ","TG","XK","MW","ET","LS","IR","BI","US","MM","MZ","GE","ZA","MV","UA","CA","CF","GB","SN","ME","AG","BE","TR","MC","JO","GY","CZ","MG","GT","PS","TT","PA","CR","GL","AM","ZM","LY","NG","VE","BO","AL","DO","CI","TD","ST","BZ","MU","T6","LI","VC","IT","BB","IQ","GM","BG","BT","NA","SA","EC","AF","NO","FI","GN","IE","XG","SG","KM","EG","IL","FR","VU","SE","HR","MA","GA","LB","UZ","BR","CH","BS","GW","PK","TZ","JP","PW","SR","PG","QA","CD","BY","T5","ZT","KI","GD"]]],"relatedIndicators",["^ ","^4","atom","^16",["IP.PAT.RESD","IP.TMK.RSCT","IP.TMK.NRCT","IP.IDS.NRCT","IP.TMK.NRES","IP.TMK.RESD","IP.PAT.NRES","IP.TMK.TOTL","IP.IDS.RSCT"]],"^3;",["^ ","^4","atom","^16","Scientific and technical journal articles"],"source",["^ ","^4","atom","^16","2"],"^37",["^ ","^4","atom","^16","Scientific and technical journal articles refer to the number of scientific and engineering articles published in the following fields: physics, biology, chemistry, mathematics, clinical medicine, biomedical research, engineering and technology, and earth and space sciences."],"^3:",["^ ","^4","atom","^16","National Science Foundation, Science and Engineering Indicators."],"sourceURL",["^ ","^4","atom"],"topics",["^ ","^4","atom","^16",[["^ ","id","14","^16","Science & Technology "]]],"unit",["^ ","^4","atom","^16","unknown"]],"^1V",["^ ","^2W",["^ ","^4","atom","^16","CC BY-4.0"],"^2X",["^ ","^4","atom","^16","https://datacatalog.worldbank.org/public-licenses#cc-by"],"^2Y",["^ ","^4","atom","^16","5.13"],"^2Z",["^ ","^4","atom","^16",0],"^2[",["^ ","^4","atom"],"en",["^ ","^4","atom","^16",["^ ","^30","The Patent Cooperation Treaty (www.wipo.int/pct) provides a two phase system for filing patent. International applications under the treaty provide for a national patent grant only - there is no international patent. The national filing represents the applicant's seeking of patent protection for a given territory, whereas international filings, while representing a legal right, do not accurately reflect where patent protection is sought. Resident filings are those from residents of the country concerned. Nonresident filings are from applicants abroad. For regional offices applications from residents of any member state of the regional patent convention are considered nonresident filings. Some offices (notably the U.S. Patent and Trademark Office) use the residence of the inventor rather than the applicant to classify filings.\n\nPatent data are a great resource for the study of technical change in a country or region. Patent data provide a uniquely detailed source of information on inventive activity and the multiple dimensions of the inventive process (e.g. geographical location, technical and institutional origin, individuals and networks). Furthermore, patent data form a consistent basis for comparisons across time and across countries.\n\nPatent data can be used in the analysis of a wide array of topics related to technical change and patenting activity including industry-science linkages, patenting strategies by companies, internationalization of research, and indicators on the value of patents. Patent-based statistics reflect the inventive performance of countries, regions and firms, as well as other aspects of the dynamics of the innovation process such as co-operation in innovation or technology paths.","^31","Resident patent applications are those for which the first-named applicant or assignee is a resident of the State or region concerned. In the case of regional offices such as the European Patent Office, a resident is an applicant from any of the member States of the regional patent convention.\n\nPatent data cover applications and grants classified by field of technology. International applications series distinguish four subcategories: a) patents taken out by residents of a country in that country; b) patents taken out in a country by non-residents of that country; c) total patents registered in the country or naming it; d) patents taken out outside a country by its residents. Data on patents granted only distinguish between patents awarded to residents and to non-residents. A patent provides protection for the invention to the owner of the patent for a limited period, generally 20 years.\n\nPatent applications are worldwide patent applications filed through the Patent Cooperation Treaty procedure or with a national patent office for exclusive rights for an invention - a product or process that provides a new way of doing something or offers a new technical solution to a problem.","^32","Sum","^33","Annual","Shortdefinition","Patent applications are worldwide patent applications filed through the Patent Cooperation Treaty procedure or with a national patent office.","^34","Infrastructure: Technology","^35","World Intellectual Property Organization (WIPO), WIPO Patent Report: Statistics on Worldwide Patent Activity. The International Bureau of WIPO assumes no responsibility with respect to the transformation of these data.","^36","Patent applications are worldwide patent applications filed through the Patent Cooperation Treaty procedure or with a national patent office for exclusive rights for an invention--a product or process that provides a new way of doing something or offers a new technical solution to a problem. A patent provides protection for the invention to the owner of the patent for a limited period, generally 20 years.","^2X","https://datacatalog.worldbank.org/public-licenses#cc-by","^37","Patent applications are worldwide patent applications filed through the Patent Cooperation Treaty procedure or with a national patent office for exclusive rights for an invention--a product or process that provides a new way of doing something or offers a new technical solution to a problem. A patent provides protection for the invention to the owner of the patent for a limited period, generally 20 years.","^2W","CC BY-4.0","^38","A patent is an exclusive right granted for a specified period (generally 20 years) for a new way of doing something or a new technical solution to a problem - an invention. The invention must be of practical use and display a characteristic unknown in the existing body of knowledge in its field. Most countries have systems to protect patentable inventions.","^3;","Patent applications, residents","^3:","World Intellectual Property Organization (WIPO), WIPO Patent Report: Statistics on Worldwide Patent Activity. The International Bureau of WIPO assumes no responsibility with respect to the transformation of these data.","^39","Patent applications, residents","^3<","Patent applications, residents"]],"^39",["^ ","^4","atom","^16","Patent applications, residents"],"id",["^ ","^4","atom","^16","IP.PAT.RESD"],"^3=",["^ ","^4","atom","^16",[2019,["MD","IS","LT","BN","SV","RO","MT","ES","TJ","PH","GR","OM","MX","AD","KE","CU","VN","HU","EE","SY","MN","T3","AR","LU","NZ","PE","JM","BD","PT","KG","PL","RU","CL","AO","CO","TH","SK","ID","AE","BW","T4","KR","AU","WS","BA","CY","DZ","DK","DE","SD","RS","IN","LV","AT","T7","SM","CN","BH","T2","NL","LK","YE","MY","AZ","IR","US","MZ","GE","ZA","UA","CA","GB","ME","BE","TR","MC","JO","CZ","GT","TT","PA","CR","AM","ZM","AL","DO","MU","IT","BB","BG","NA","SA","EC","NO","FI","IE","SG","EG","IL","FR","HK","SE","HR","MA","UZ","BR","CH","PK","JP","QA","BY","T5","ZT"]]],"^3>",["^ ","^4","atom","^16",["IP.PAT.NRES","IP.TMK.RSCT","IP.TMK.NRCT","IP.IDS.NRCT","IP.TMK.NRES","IP.TMK.RESD","IP.TMK.TOTL","IP.IDS.RSCT","IP.JRN.ARTC.SC"]],"^3;",["^ ","^4","atom","^16","Patent applications, residents"],"^3?",["^ ","^4","atom","^16","2"],"^37",["^ ","^4","atom","^16","Patent applications are worldwide patent applications filed through the Patent Cooperation Treaty procedure or with a national patent office for exclusive rights for an invention--a product or process that provides a new way of doing something or offers a new technical solution to a problem. A patent provides protection for the invention to the owner of the patent for a limited period, generally 20 years."],"^3:",["^ ","^4","atom","^16","World Intellectual Property Organization (WIPO), WIPO Patent Report: Statistics on Worldwide Patent Activity. The International Bureau of WIPO assumes no responsibility with respect to the transformation of these data."],"^3@",["^ ","^4","atom"],"^3A",["^ ","^4","atom","^16",[["^ ","id","14","^16","Science & Technology "]]],"^3B",["^ ","^4","atom","^16","unknown"]],"^1W",["^ ","^2W",["^ ","^4","atom","^16","CC BY-4.0"],"^2X",["^ ","^4","atom","^16","https://datacatalog.worldbank.org/public-licenses#cc-by"],"^2Y",["^ ","^4","atom"],"^2Z",["^ ","^4","atom","^16",0],"^2[",["^ ","^4","atom"],"en",["^ ","^4","atom","^16",["^ ","^32","Sum","^33","Annual","^34","Infrastructure: Technology","^35","World Intellectual Property Organization (WIPO), Statistics Database at www.wipo.int/ipstats/. The International Bureau of WIPO assumes no responsibility with respect to the transformation of these data.","^36","Trademark applications filed are applications to register a trademark with a national or regional Intellectual Property (IP) offices and designations received by relevant offices through the Madrid System. A trademark is a distinctive sign which identifies certain goods or services as those produced or provided by a specific person or enterprise. A trademark provides protection to the owner of the mark by ensuring the exclusive right to use it to identify goods or services, or to authorize another to use it in return for payment. The period of protection varies, but a trademark can be renewed indefinitely beyond the time limit on payment of additional fees. Resident application refers to an application filed with the IP office of or acting on behalf of the state or jurisdiction in which the first-named applicant in the application has residence. Class count is used to render application data for trademark applications across offices comparable, as some offices follow a single-class/single-design filing system while other have a multiple class/design filing system.","^2X","https://datacatalog.worldbank.org/public-licenses#cc-by","^37","Trademark applications filed are applications to register a trademark with a national or regional Intellectual Property (IP) offices and designations received by relevant offices through the Madrid System. A trademark is a distinctive sign which identifies certain goods or services as those produced or provided by a specific person or enterprise. A trademark provides protection to the owner of the mark by ensuring the exclusive right to use it to identify goods or services, or to authorize another to use it in return for payment. The period of protection varies, but a trademark can be renewed indefinitely beyond the time limit on payment of additional fees. Resident application refers to an application filed with the IP office of or acting on behalf of the state or jurisdiction in which the first-named applicant in the application has residence. Class count is used to render application data for trademark applications across offices comparable, as some offices follow a single-class/single-design filing system while other have a multiple class/design filing system.","^2W","CC BY-4.0","^38","Depending on different legal systems, one or more classes can be specified in a trademark application, with the intent to obtain protection of the mark across different goods and/or services. For cross country comparison purposes, users are advised to refer to the trademark data rendered by the class count in the database 2004 onwards. Data are based on information supplied to World Intellectual Property Organization (WIPO) by IP off ons received by relevant offices through the Madrid System. A trademark is a distinctive sign which identifies certain goods or services as those produced or provided by a specific person or enterprise. A trademark provides protection to the owner of the mark by ensuring the exclusive right to use it to identify goods or services, or to authorize another to use it in return for payment. The period of protection varies, but a trademark can be renewed indefinitely beyond the time limit on payment of additional fees. Non-resident application refers to an application filed with the IP office of or acting on behalf of a state or jurisdiction in which the first-named applicant in the application is not domiciled. Class count is used to render application data for trademark applications across offices comparable, as some offices follow a single-class/single-design filing system while other have a multiple class/design filing system."],"^3:",["^ ","^4","atom","^16","World Intellectual Property Organization (WIPO), Statistics Database at www.wipo.int/ipstats/. The International Bureau of WIPO assumes no responsibility with respect to the transformation of these data."],"^3@",["^ ","^4","atom"],"^3A",["^ ","^4","atom","^16",[["^ ","id","9","^16","Infrastructure "]]],"^3B",["^ ","^4","atom","^16","unknown"]],"^1Y",["^ ","^2W",["^ ","^4","atom","^16","CC BY-4.0"],"^2X",["^ ","^4","atom","^16","https://datacatalog.worldbank.org/public-licenses#cc-by"],"^2Y",["^ ","^4","atom"],"^2Z",["^ ","^4","atom","^16",0],"^2[",["^ ","^4","atom"],"en",["^ ","^4","atom","^16",["^ ","^32","Sum","^33","Annual","^34","Infrastructure: Technology","^35","World Intellectual Property Organization (WIPO), Statistics Database at www.wipo.int/ipstats/. The International Bureau of WIPO assumes no responsibility with respect to the transformation of these data.","^36","Industrial design applications are applications to register an industrial design with a national or regional Intellectual Property (IP) offices and designations received by relevant offices through the Hague System. Industrial designs are applied to a wide variety of industrial products and handicrafts. They refer to the ornamental or aesthetic aspects of a useful article, including compositions of lines or colors or any three-dimensional forms that give a special appearance to a product or handicraft. The holder of a registered industrial design has exclusive rights against unauthorized copying or imitation of the design by third parties. Industrial design registrations are valid for a limited period. The term of protection is usually 15 years for most jurisdictions. However, differences in legislation do exist, notably in China (which provides for a 10-year term from the application date). Non-resident application refers to an application filed with the IP office of or acting on behalf of a state or jurisdiction in which the first-named applicant in the application is not domiciled. Design count is used to render application data for industrial applications across offices comparable, as some offices follow a single-class/single-design filing system while other have a multiple class/design filing system.","^2X","https://datacatalog.worldbank.org/public-licenses#cc-by","^37","Industrial design applications are applications to register an industrial design with a national or regional Intellectual Property (IP) offices and designations received by relevant offices through the Hague System. Industrial designs are applied to a wide variety of industrial products and handicrafts. They refer to the ornamental or aesthetic aspects of a useful article, including compositions of lines or colors or any three-dimensional forms that give a special appearance to a product or handicraft. The holder of a registered industrial design has exclusive rights against unauthorized copying or imitation of the design by third parties. Industrial design registrations are valid for a limited period. The term of protection is usually 15 years for most jurisdictions. However, differences in legislation do exist, notably in China (which provides for a 10-year term from the application date). Non-resident application refers to an application filed with the IP office of or acting on behalf of a state or jurisdiction in which the first-named applicant in the application is not domiciled. Design count is used to render application data for industrial applications across offices comparable, as some offices follow a single-class/single-design filing system while other have a multiple class/design filing system.","^2W","CC BY-4.0","^38","An industrial design right protects only the appearance or aesthetic features of a product, whereas a patent protects an invention that offers a new technical solution to a problem. In principle, an industrial design right does not protect the technical or functional features of a product. Industrial design registrations are valid for a limited period. The term of protection is usually 15 years for most jurisdictions. However, differences in legislation do exist, notably in China (which provides for a 10-year term from the application date). Data are based on information supplied to World Intellectual Property Organization (WIPO) by IP offices in annual surveys, supplemented by data in national IP office reports. Data may be missing for some offices or periods.","^39","Industrial design applications, nonresident, by count","^3:","World Intellectual Property Organization (WIPO), Statistics Database at www.wipo.int/ipstats/. The International Bureau of WIPO assumes no responsibility with respect to the transformation of these data.","^3;","Industrial design applications, nonresident, by count","^3<","Industrial design applications, nonresident, by count"]],"^39",["^ ","^4","atom","^16","Industrial design applications, nonresident, by count"],"id",["^ ","^4","atom","^16","IP.IDS.NRCT"],"^3=",["^ ","^4","atom","^16",[2019,["MD","IS","LT","BN","SV","RO","ES","MR","PH", t Report: Statistics on Worldwide Patent Activity. The International Bureau of WIPO assumes no responsibility with respect to the transformation of these data."],"^3@",["^ ","^4","atom"],"^3A",["^ ","^4","atom","^16",[["^ ","id","14","^16","Science & Technology "]]],"^3B",["^ ","^4","atom","^16","unknown"]],"^20",["^ ","^2W",["^ ","^4","atom","^16","CC BY-4.0"],"^2X",["^ ","^4","atom","^16","https://datacatalog.worldbank.org/public-licenses#cc-by"],"^2Y",["^ ","^4","atom","^16","5.13"],"^2Z",["^ ","^4","atom","^16",0],"^2[",["^ ","^4","atom"],"en",["^ ","^4","atom","^16",["^ ","^30","The Patent Cooperation Treaty (www.wipo.int/pct) provides a two phase system for filing patent. International applications under the treaty provide for a national patent grant only - there is no international patent. The national filing represents the applicant's seeking of patent protection for a given territory, whereas international filings, while representing a legal right, do not accurately reflect where patent protection is sought. Resident filings are those from residents of the country concerned. Nonresident filings are from applicants abroad. For regional offices applications from residents of any member state of the regional patent convention are considered nonresident filings. Some offices (notably the U.S. Patent and Trademark Office) use the residence of the inventor rather than the applicant to classify filings.\n\nPatent data are a great resource for the study of technical change in a country or region. Patent data provide a uniquely detailed source of information on inventive activity and the multiple dimensions of the inventive process (e.g. geographical location, technical and institutional origin, individuals and networks). Furthermore, patent data form a consistent basis for comparisons across time and across countries.\n\nPatent data can be used in the analysis of a wide array of topics related to technical change and patenting activity including industry-science linkages, patenting strategies by companies, internationalization of research, and indicators on the value of patents. Patent-based statistics reflect the inventive performance of countries, regions and firms, as well as other aspects of the dynamics of the innovation process such as co-operation in innovation or technology paths.","^31","Non-resident patent applications are from applicants outside the relevant State or region. Patent data cover applications and grants classified by field of technology. International applications series distinguish four subcategories: a) patents taken out by residents of a country in that country; b) patents taken out in a country by non-residents of that country; c) total patents registered in the country or naming it; d) patents taken out outside a country by its residents. Data on patents granted only distinguish between patents awarded to residents and to non-residents. A patent provides protection for the invention to the owner of the patent for a limited period, generally 20 years.\n\nPatent applications are worldwide patent applications filed through the Patent Cooperation Treaty procedure or with a national patent office for exclusive rights for an invention - a product or process that provides a new way of doing something or offers a new technical solution to a problem.","^32","Sum","^33","Annual","^3C","Patent applications are worldwide patent applications filed through the Patent Cooperation Treaty procedure or with a national patent office.","^34","Infrastructure: Technology","^35","World Intellectual Property Organization (WIPO), WIPO Patent Report: Statistics on Worldwide Patent Activity. The International Bureau of WIPO assumes no responsibility with respect to the transformation of these data.","^36","Patent applications are worldwide patent applications filed through the Patent Cooperation Treaty procedure or with a national patent office for exclusive rights for an invention--a product or process that provides a new way of doing something or offers a new technical solution to a problem. A patent provides protection for the invention to the owner of the patent for a limited period, generally 20 years.","^2X","https://datacatalog.worldbank.org/public-licenses#cc-by","^37","Patent applications are worldwide patent applications filed through the Patent Cooperation Treaty procedure or with a national patent office for exclusive rights for an invention--a product or process that provides a new way of doing something or offers a new technical solution to a problem. A patent provides protection for the invention to the owner of the patent for a limited period, generally 20 years.","^2W","CC BY-4.0","^38","A patent is an exclusive right granted for a specified period (generally 20 years) for a new way of doing something or a new technical solution to a problem - an invention. The invention must be of practical use and display a characteristic unknown in the existing body of knowledge in its field. Most countries have systems to protect patentable inventions.\n\nUnless otherwise stated, statistics on the number of resident and non-resident patent applications include those filed via the PCT system as PCT national/regional phase entries.","^3;","Patent applications, nonresidents","^3:","World Intellectual Property Organization (WIPO), WIPO Patent Report: Statistics on Worldwide Patent Activity. The International Bureau of WIPO assumes no responsibility with respect to the transformation of these data.","^39","Patent applications, nonresidents","^3<","Patent applications, nonresidents"]],"^39",["^ ","^4","atom","^16","Patent applications, nonresidents"],"id",["^ ","^4","atom","^16","IP.PAT.NRES"],"^3=",["^ ","^4","atom","^16",[2019,["MD","IS","LT","BN","SV","RO","MT","CV","ES","TJ","PH","GR","OM","MX","AD","KE","CU","VN","HU","EE","SY","MN","T3","AR","HN","LU","NZ","PE","JM","BD","PT","KG","PL","RU","CL","AO","CO","TH","SK","ID","AE","MO","T4","KR","AU","WS","BA","CY","DZ","DK","DE","SD","RS","IN","LV","AT","T7","SM","CN","BH","T2","NL","LK","YE","MY","SC","AZ","IR","US","MZ","GE","ZA","UA","CA","GB","BE","TR","MC","JO","CZ","MG","GT","TT","PA","CR","AM","ZM","AL","DO","BZ","MU","VC","IT","GM","BG","NA","SA","EC","NO","FI","IE","SG","EG","IL","FR","HK","SE","HR","MA","UZ","BR","CH","PK","JP","QA","BY","T5","ZT"]]],"^3>",["^ ","^4","atom","^16",["IP.PAT.RESD","IP.TMK.RSCT","IP.TMK.NRCT","IP.IDS.NRCT","IP.TMK.NRES","IP.TMK.RESD","IP.TMK.TOTL","IP.IDS.RSCT","IP.JRN.ARTC.SC"]],"^3;",["^ ","^4","atom","^16","Patent applications, nonresidents"],"^3?",["^ ","^4","atom","^16","2"],"^37",["^ ","^4","atom","^16","Patent applications are worldwide patent applications filed through the Patent Cooperation Treaty procedure or with a national patent office for exclusive rights for an invention--a product or process that provides a new way of doing something or offers a new technical solution to a problem. A patent provides protection for the invention to the owner of the patent for a limited period, generally 20 years."],"^3:",["^ ","^4","atom","^16","World Intellectual Property Organization (WIPO), WIPO Patent Report: Statistics on Worldwide Patent Activity. The International Bureau of WIPO assumes no responsibility with respect to the transformation of these data."],"^3@",["^ ","^4","atom"],"^3A",["^ ","^4","atom","^16",[["^ ","id","14","^16","Science & Technology "]]],"^3B",["^ ","^4","atom","^16","unknown"]],"^21",["^ ","^2W",["^ ","^4","atom","^16","CC BY-4.0"],"^2X",["^ ","^4","atom","^16","https://datacatalog.worldbank.org/public-licenses#cc-by"],"^2Y",["^ ","^4","atom","^16","5.13"],"^2Z",["^ ","^4","atom","^16",0],"^2[",["^ ","^4","atom"],"en",["^ ","^4","atom","^16",["^ ","^30","A trademark is a distinctive sign that identifies certain goods or services as those produced or provided by a specific person or enterprise. The holder of a registered trademark has the legal right to exclusive use of the mark in relation to the products or services for which it is registered. The owner can prevent unauthorized use of the trademark, or a confusingly similar mark, so as to prevent consumers and the public in general from being misled. Unlike patents, trademarks can be maintained indefinitely by paying renewal fees.\n\n The procedures for registering trademarks are governed by the rules and regulations of national and regional IP offices. Trademark rights are limited to the jurisdiction of the authority that registers the trademark. Trademarks can be registered by filing an application at the relevant national or regional office(s), or by filing an international application through the Madrid system.\n\nMany offices in middle- and low-income economies have considerably high numbers of trademark applications compared to other forms of IP, showing the emphasis placed on trademark rights in these markets.","^31","A trademark is a distinctive sign identifying goods or services as produced or provided by a specific person or enterprise. A trademark protects the owner of the mark by ensuring exclusive right to use it to identify goods or services or to authorize another to use it. The period of protection varies, but a trademark can be renewed indefinitely for an additional fee.","^32","Sum","^33","Annual","^3C","Trademark applications filed are applications to register a trademark with a national or regional Intellectual Property (IP) office.","^34","Infrastructure: Technology","^35","World Intellectual Property Organization (WIPO), World Intellectual Property Indicators and www.wipo.int/econ_stat. The International Bureau of WIPO assumes no responsibility with respect to the transformation of these data.","^36","Trademark applications filed are applications to register a trademark with a national or regional Intellectual Property (IP) office. A trademark is a distinctive sign which identifies certain goods or services as those produced or provided by a specific person or enterprise. A trademark provides protection to the owner of the mark by ensuring the exclusive right to use it to identify goods or services, or to authorize another to use it in return for payment. The period of protection varies, but a trademark can be renewed indefinitely beyond the time limit on payment of additional fees.","^2X","https://datacatalog.worldbank.org/public-licenses#cc-by","^37","Trademark applications filed are applications to register a trademark with a national or regional Intellectual Property (IP) office. A trademark is a distinctive sign which identifies certain goods or services as those produced or provided by a specific person or enterprise. A trademark provides protection to the owner of the mark by ensuring the exclusive right to use it to identify goods or services, or to authorize another to use it in return for payment. The period of protection varies, but a trademark can be renewed indefinitely beyond the time limit on payment of additional fees.","^2W","CC BY-4.0","^38","Detailed components of trademark filings are available at the World Bank at http://data.worldbank.org. Data includes applications filed by direct residents (domestic applicants filing directly at a given national or regional intellectual property [IP] office); direct nonresident (foreign applicants filing directly at a given national or regional IP office); aggregate direct (applicants not identified as direct resident or direct nonresident by the national or regional office); and Madrid (designations received by the national or regional IP office based on international applications filed via the World Intellectual Property Organization-administered Madrid System).\n\nData are based on information supplied to World Intellectual Property Organization (WIPO) by IP offices in annual surveys, supplemented by data in national IP office reports. Data may be missing for some offices or periods.\n\nTrademark registrations are exclusive rights, issued to an applicant by an IP office. For example, registrations are issued to applicants to make use of and exploit their trademark or industrial design for a limited period of time and can, in some cases, particularly in the case of trademarks, be renewed indefinitely.","^3;","Trademark applications, total","^3:","World Intellectual Property Organization (WIPO), World Intellectual Property Indicators and www.wipo.int/econ_stat. The International Bureau of WIPO assumes no responsibility with respect to the transformation of these data.","^39","Trademark applications, total","^3<","Trademark applications, total"]],"^39",["^ ","^4","atom","^16","Trademark applications, total"],"id",["^ ","^4","atom","^16","IP.TMK.TOTL"],"^3=",["^ ","^4","atom","^16",[2019,["MD","IS","LT","BN","SV","RO","MT","CW","CV","ES","TJ","PH","KH","GR","OM","RW","MX","AD","KE","CU","ZW","VN","HU","EE","SY","MN","SL","T3","AR","HN","NZ","PE","JM","BD","PT","KG","PL","RU","CL","AO","CO","TH","SK","ID","AE","MO","DM","BW","KR","AU","KZ","WS","BA","DZ","DK","DE","SD","RS","IN","LV","AT","T7","SM","UY","BH","T2","LK","YE","MY","SC","AZ","IR","US","MZ","GE","ZA","UA","CA","GB","ME","BE","TR","MC","JO","CZ","MG","GT","TT","PA","CR","AM","ZM","NG","DO","ST","BZ","MU","LI","VC","IT","BB","GM","BG","NA","SA","EC","NO","FI","IE","SG","EG","IL","FR","HK","SE","HR","MA","UZ","BR","CH","PK","JP","QA","BY","T5"]]],"^3>",["^ ","^4","atom","^16",["IP.TMK.RSCT","IP.TMK.NRCT","IP.TMK.NRES","IP.TMK.RESD","IP.PAT.RESD","IP.IDS.NRCT","IP.PAT.NRES","IP.IDS.RSCT","IP.JRN.ARTC.SC"]],"^3;",["^ ","^4","atom","^16","Trademark applications, total"],"^3?",["^ ","^4","atom","^16","2"],"^37",["^ ","^4","atom","^16","Trademark applications filed are applications to register a trademark with a national or regional Intellectual Property (IP) office. A trademark is a distinctive sign which identifies certain goods or services as those produced or provided by a specific person or enterprise. A trademark provides protection to the owner of the mark by ensuring the exclusive right to use it to identify goods or services, or to authorize another to use it in return for payment. The period of protection varies, but a trademark can be renewed indefinitely beyond the time limit on payment of additional fees."],"^3:",["^ ","^4","atom","^16","World Intellectual Property Organization (WIPO), World Intellectual Property Indicators and www.wipo.int/econ_stat. The International Bureau of WIPO assumes no responsibility with respect to the transformation of these data."],"^3@",["^ ","^4","atom"],"^3A",["^ ","^4","atom","^16",[["^ ","id","14","^16","Science & Technology "]]],"^3B",["^ ","^4","atom","^16","unknown"]],"^22",["^ ","^2W",["^ ","^4","atom","^16","CC BY-4.0"],"^2X",["^ ","^4","atom","^16","https://datacatalog.worldbank.org/public-licenses#cc-by"],"^2Y",["^ ","^4","atom"],"^2Z",["^ ","^4","atom","^16",0],"^2[",["^ ","^4","atom"],"en",["^ ","^4","atom","^16",["^ ","^32","Sum","^33","Annual","^34","Infrastructure: Technology","^35","World Intellectual Property Organization (WIPO), Statistics Database at www.wipo.int/ipstats/. The International Bureau of WIPO assumes no responsibility with respect to the transformation of these data.","^36","Industrial design applications are applications to register an industrial design with a national or regional Intellectual Property (IP) offices and designations received by relevant offices through the Hague System. Industrial designs are applied to a wide variety of industrial products and handicrafts. They refer to the ornamental or aesthetic aspects of a useful article, including compositions of lines or colors or any three-dimensional forms that give a special appearance to a product or handicraft. The holder of a registered industrial design has exclusive rights against unauthorized copying or imitation of the design by third parties. Industrial design registrations are valid for a limited period. The term of protection is usually 15 years for most jurisdictions. However, differences in legislation do exist, notably in China (which provides for a 10-year term from the application date). Resident application refers to an application filed with the IP office of or acting on behalf of the state or jurisdiction in which the first-named applicant in the application has residence. Design count is used to render application data for industrial applications across offices comparable, as some offices follow a single-class/single-design filing system while other have a multiple class/design filing system.","^2X","https://datacatalog.worldbank.org/public-licenses#cc-by","^37","Industrial design applications are applications to register an industrial design with a national or regional Intellectual Property (IP) offices and designations received by relevant offices through the Hague System. Industrial designs are applied to a wide variety of industrial products and handicrafts. They refer to the ornamental or aesthetic aspects of a useful article, including compositions of lines or colors or any three-dimensional forms that give a special appearance to a product or handicraft. The holder of a registered industrial design has exclusive rights against unauthorized copying or imitation of the design by third parties. Industrial design registrations are valid for a limited period. The term of protection is usually 15 years for most jurisdictions. However, differences in legislation do exist, notably in China (which provides for a 10-year term from the application date). Resident application refers to an application filed with the IP office of or acting on behalf of the state or jurisdiction in which the first-named applicant in the application has residence. Design count is used to render application data for industrial applications across offices comparable, as some offices follow a single-class/single-design filing system while other have a multiple class/design filing system.","^2W","CC BY-4.0","^38","An industrial design right protects only the appearance or aesthetic features of a product, whereas a patent protects an invention that offers a new technical solution to a problem. In principle, an industrial design right does not protect the technical or functional features of a product. Industrial design registrations are valid for a limited period. The term of protection is usually 15 years for most jurisdictions. However, differences in legislation do exist, notably in China (which provides for a 10-year term from the application date). Data are based on information supplied to World Intellectual Property Organization (WIPO) by IP offices in annual surveys, supplemented by data in national IP office reports. Data may be missing for some offices or periods.","^39","Industrial design applications, resident, by count","^3:","World Intellectual Property Organization (WIPO), Statistics Database at www.wipo.int/ipstats/. The International Bureau of WIPO assumes no responsibility with respect to the transformation of these data.","^3;","Industrial design applications, resident, by count","^3<","Industrial design applications, resident, by count"]],"^39",["^ ","^4","atom","^16","Industrial design applications, resident, by count"],"id",["^ ","^4","atom","^16","IP.IDS.RSCT"],"^3=",["^ ","^4","atom","^16",[2019,["MD","IS","LT","SV","RO","MT","ES","MR","PH","GR","OM","RW","MX","KE","CU","MK","VN","HU","EE","SY","MN","T3","AR","NZ","PE","JM","BD","PT","RU","CL","CO","TH","SK","ID","AE","MO","T4","KR","AU","WS","BA","CY","DZ","DK","DE","RS","IN","LV","T7","SM","CN","BH","T2","LK","YE","MY","AZ","IR","US","MZ","GE","ZA","UA","CA","GB","ME","TR","MC","JO","CZ","MG","GT","TT","CR","AM","ZM","DO","BZ","LI","IT","BG","NA","SA","EC","NO","FI","IE","SG","EG","IL","FR","HK","SE","HR","MA","UZ","BR","CH","PK","JP","BY","T5","ZT"]]],"^3>",["^ ","^4","atom","^16",["IP.IDS.NRCT","IP.PAT.RESD","IP.TMK.RSCT","IP.TMK.NRCT","IP.TMK.NRES","IP.TMK.RESD","IP.PAT.NRES","IP.TMK.TOTL","IP.JRN.ARTC.SC"]],"^3;",["^ ","^4","atom","^16","Industrial design applications, resident, by count"],"^3?",["^ ","^4","atom","^16","2"],"^37",["^ ","^4","atom","^16","Industrial design applications are applications to register an industrial design with a national or regional Intellectual Property (IP) offices and designations received by relevant offices through the Hague System. Industrial designs are applied to a wide variety of industrial products and handicrafts. They refer to the ornamental or aesthetic aspects of a useful article, including compositions of lines or colors or any three-dimensional forms that give a special appearance to a product or handicraft. The holder of a registered industrial design has exclusive rights against unauthorized copying or imitation of the design by third parties. Industrial design registrations are valid for a limited period. The term of protection is usually 15 years for most jurisdictions. However, differences in legislation do exist, notably in China (which provides for a 10-year term from the application date). Resident application refers to an application filed with the IP office of or acting on behalf of the state or jurisdiction in which the first-named applicant in the application has residence. Design count is used to render application data for industrial applications across offices comparable, as some offices follow a single-class/single-design filing system while other have a multiple class/design filing system."],"^3:",["^ ","^4","atom","^16","World Intellectual Property Organization (WIPO), Statistics Database at www.wipo.int/ipstats/. The International Bureau of WIPO assumes no responsibility with respect to the transformation of these data."],"^3@",["^ ","^4","atom"],"^3A",["^ ","^4","atom","^16",[["^ ","id","9","^16","Infrastructure "]]],"^3B",["^ ","^4","atom","^16","unknown"]]],"lists",["^ ","countries",["^ ","en",["^ ","^4","atom","^16",[["^ ","en",["^ ","^2K","Bangladesh"],"^2K","Bangladesh","^2S","country","id","BD"],["^ ","en",["^ ","^2K","Belgium"],"^2K","Belgium","^2S","country","id","BE"],["^ ","en",["^ ","^2K","Burkina Fa
